scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To get value associated with the context key myContextKey: 
query_results = scriptletContext.get("query_results"); 
queryCount = scriptletContext.get("queryCount");
nombre_query = scriptletContext.get("nombre_query");
fecha_proceso = scriptletContext.get("fecha_proceso");

var d = new Date();
var curr_date = d.getDate();
var curr_month = d.getMonth()+1;
var curr_year = d.getFullYear();
var UID_FECHA_PROCESO = curr_year+"-"+curr_month+"-"+curr_date;

var insert="";
var count = 0;
if(queryCount > 0){

    linea = query_results.split("\n");

	for(i=0; i < linea.length; i++){

		if(count == 0) { insert+="BEGIN\n"; }

	    linea_insert = linea[i];
		linea_insert2="";

		if(nombre_query == 'RevDesfasado'){
			linea2 = linea_insert.split(",");
		    linea_insert2 += "TO_DATE('"+linea2[0]+"','YYYY-MM-DD HH24:MI:SS'),"; /*FH_ORIGEN_TRAN*/
		    linea_insert2 += "'"+linea2[1]+"',"; /*CODIGO_ATM*/
		    linea_insert2 += "'"+linea2[2]+"',"; /*NUMERO_SEC_TRANS*/
		    linea_insert2 += "'"+linea2[3]+"',";/*BAN_CODIGO_BANCO*/
		    linea_insert2 += "'"+linea2[4]+"',"; /*CODIGO_BANCO*/
		    linea_insert2 += "'"+linea2[5]+"',"; /*NUMERO_CUENTA_ACCESO*/
		    linea_insert2 += "TO_DATE('"+linea2[6]+"','YYYY-MM-DD HH24:MI:SS'),"; /*FH_ENTRADA_B24*/
		    linea_insert2 += linea2[7]+","; /*DESFASE_SEG*/
		    linea_insert2 += "'"+linea2[8]+"',"; /*Reversos Desfasados'*/
		    linea_insert2 += "TO_DATE('"+linea2[9]+"','YYYY-MM-DD HH24:MI:SS'),"; /*FECHA_CARGA*/
		    linea_insert2 += "'"+linea2[10]+"'"; /*SAN*/

			insert+='INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_FH_ORIGEN_TRAN,UID_CODIGO_ATM,UID_NUMERO_SEC_TRANS,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_NUMERO_CUENTA_ACCESO,UID_FH_ENTRADA_B24,UID_DESFASE_SEG,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES (to_date("'+fecha_proceso+'","yyyy-mm-dd"),'+linea_insert2+'); \n';
		}
		if(nombre_query == 'RevMultiples'){
			linea2 = linea_insert.split(",");
			linea_insert2 += "TO_DATE('"+linea2[0]+"','YYYY-MM-DD HH24:MI:SS'),"; /*FH_ORIGEN_TRAN*/
			linea_insert2 += "'"+linea2[1]+"',"; /*CODIGO_ATM*/
			linea_insert2 += "'"+linea2[2]+"',"; /*NUMERO_SEC_TRANS*/
			linea_insert2 += linea2[3]+","; /*ORDEN*/
			linea_insert2 += "'"+linea2[4]+"',";/*BAN_CODIGO_BANCO*/
			linea_insert2 += "'"+linea2[5]+"',"; /*CODIGO_BANCO*/
			linea_insert2 += "'"+linea2[6]+"',"; /*Reversos Multiples*/
			linea_insert2 += "TO_DATE('"+linea2[7]+"','YYYY-MM-DD HH24:MI:SS'),"; /*FECHA_CARGA*/
			linea_insert2 += "'"+linea2[8]+"'"; /*SAN*/
			insert+='INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_FH_ORIGEN_TRAN,UID_CODIGO_ATM,UID_NUMERO_SEC_TRANS,UID_ORDEN,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_DESCRIPCION,UID_FECHA_CARGA,UID_SERVICIO) VALUES (to_date("'+fecha_proceso+'","yyyy-mm-dd"),'+linea_insert2+'); \n';
		}
		if(nombre_query == 'Codigo72'){
			linea2 = linea_insert.split(",");
			//UID_TOTAL_TNX,UID_CODIGO_BANCO,UID_RAZON_RESPUESTA,UID_FECHA_CARGA

			linea_insert2 += linea2[0]+","; /*UID_TOTAL_TNX*/
			linea_insert2 += "'"+linea2[1]+"',"; /*UID_BAN_CODIGO_BANCO*/
			linea_insert2 += "'NA',"; /*UID_CODIGO_BANCO*/
			linea_insert2 += "'"+linea2[2]+"',"; /*RAZON_RESPUESTA*/
			linea_insert2 += "TO_DATE('"+linea2[3]+"','YYYY-MM-DD  HH24:MI:SS'),"; /*FECHA_CARGA*/
			linea_insert2 += "'Codigo 72',"; /*Codigo 72*/
			linea_insert2 += "'SAN'"; /*SAN*/
		 	insert+='INSERT INTO TBL_RED_USO_INFRA_DIARIO (UID_FECHA_PROCESO,UID_TOTAL_TNX,UID_BAN_CODIGO_BANCO,UID_CODIGO_BANCO,UID_RAZON_RESPUESTA,UID_FECHA_CARGA,UID_DESCRIPCION,UID_SERVICIO) VALUES (to_date("'+fecha_proceso+'","yyyy-mm-dd"),'+linea_insert2+'); \n';
		}
		count++;

		if(count == 1000) { insert += "|"; count = 0;}

	insert = insert.replace(/\"/g,"'"); insert = insert.replace(/null/g,"''");

	} // fin for

	insert += "|";

} // fin if


// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 
scriptletContext.putGlobal("INSERT_SENTENCE", insert);
scriptletContext.putGlobal("CONTADOR", count);
// ===========================================================================================
